import React from 'react';
import { NavLink } from 'react-router-dom';

function ListPhotoItem({photo}) {
    return (
        <li><NavLink to={`photo?albumid=${photo.id}`}>{photo.title}</NavLink></li>
    );
}

export default ListPhotoItem;
